from collections import Counter, defaultdict
import unittest
from time import time


class Solution:

    def minWindow(self, s: str, t: str) -> str:

        if s == t:
            return s

        minSub = s * 2
        start, end = 0, 1
        cnt_ref = Counter(t)
        while end <= len(s):
            substring = s[start: end]
            # print('substring:', substring)
            cnt_sub = Counter(substring)
            # print(len(cnt_ref - cnt_sub))
            # print()
            while len(cnt_ref - cnt_sub) == 0 and start <= end:
                if len(substring) == len(t):
                    return substring
                if len(substring) < len(minSub):
                    # print(f'minSub updated from {minSub} to {substring}')
                    minSub = substring
                substring = s[start: end]
                # print('substring:', substring)
                # print(len(cnt_ref - cnt_sub))
                # print()
                cnt_sub = Counter(substring)
                start += 1
            end += 1
        
        if minSub == 2 * s:
            return ''
        return minSub


class Solution2:

    def minWindow(self, s: str, t: str) -> str:

        cnt_ref = Counter(t)
        filtered_s = []
        for i, char in enumerate(s):
            if char in cnt_ref:
                filtered_s.append((i, char))

        formed = 0
        required = len(cnt_ref)
        l, r = 0, 0
        ans = float('inf'), None, None
        window_chars = defaultdict(int)

        while r < len(filtered_s):
            char = filtered_s[r][1]
            window_chars[char] += 1

            if window_chars[char] == cnt_ref[char]:
                formed += 1

            while l <= r and formed == required:
                start = filtered_s[l][0]
                end = filtered_s[r][0]
                if end - start + 1 < ans[0]:
                    ans = (end - start + 1, start, end)
                char = filtered_s[l][1]
                window_chars[char] -= 1
                if window_chars[char] < cnt_ref[char]:
                    formed -= 1
                l += 1

            r += 1

        return '' if ans[0] == float('inf') else s[ans[1]: ans[2] + 1]
            


class Tests(unittest.TestCase):

    def setUp(self):
        self.func = Solution2().minWindow

    def test_examples(self):
        t0 = time()
        s = 'ADOBECODEBANC'
        t = 'ABC'
        self.assertEqual(self.func(s, t), 'BANC')

        s = 'a'
        t = 'a'
        self.assertEqual(self.func(s, t), 'a')
        
        s = 'a'
        t = 'aa'
        self.assertEqual(self.func(s, t), '')
        
        s = 'ab'
        t = 'b'
        self.assertEqual(self.func(s, t), 'b')
        
        s = 'abc'
        t = 'ac'
        self.assertEqual(self.func(s, t), 'abc')

        s = ''
        t = ''
        ans = ''
        self.assertEqual(self.func(s, t), ans)
        print(time() - t0) # previously it took 80 seconds


def main():
    unittest.main()

if __name__ == '__main__':
    main()